import React, { useEffect, useState } from 'react';

import './UserPage.css';

const UserPage = () => {

    return (
        <div className="user-page">
            <div className="profile">
                <img src="path_to_profile_picture.jpg" alt="Profile" className="profile-pic"/>
                <h1 className="username">Username</h1>
                <p className="description">This is the user's profile description.</p>
            </div>
            <div className="tabs">
                <button className="tab-button" id="collections-tab">Collections</button>
                <button className="tab-button" id="generated-tab">Generated Images</button>
            </div>
            <div className="content">
                {/* Content will change based on the active tab */}
            </div>
        </div>
    );
};

export default UserPage;
